import React from 'react';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <>

      <Routes>
        <Route path='/' element={<Homepag />} />
        <Route path='/weather' element={<Weather />} />


      </Routes>

    </>
  );
}



export default App;
